                <svg width="20" height="20" viewBox="0 0 20 20" fill="#FFFFFF" xmlns="http://www.w3.org/2000/svg"></svg>
                <input type="text" placeholder="Try Saree, Kurti or Search by Product Code"/>
            </div>
            
        </div>
    );
}
export default Nav;
